import React from "react";
import "./Navbar.css"

const Navbar = () => {
    return (
      <div className="Navbar">
            <span className="nav-logo">Dev.Tech</span>
            <div className="nav-items">
               <a href="/home">Home</a>
               <a href="/home">About</a>
               <a href="/home">Service</a>
               <a href="/home">Concact</a>
            </div>
       </div>
    );
};

export default Navbar
